    vector<int> closestPrimes(int left, int right) { //Time & Space complexity O( N / Log(N) )
        int n = primegaps_str.length();
        if(left==right) return {-1,-1};
        if(left<=2&&right>=3) return {2,3};
        int prime_idx=0;
        int prime = 2;
        int min_gap=INT_MAX;
        vector<int> ans = {-1,-1};
        
        for(int i = 0;i<n; i++) {
            int gap = decode(primegaps_str[i]);
            int next_prime = prime+gap;
            if(next_prime>right) break;
            if(prime>=left) {
                if(gap==2) return {prime,next_prime};
                if(gap<min_gap) {
                    min_gap=gap;
                    ans[0]=prime;
                    ans[1]=next_prime;
                }
            }
            prime=next_prime;
        }
        return ans;
    }


    vector<int> closestPrimes_v04(int left, int right) {
        vector<int> is_primes = vector<int>(right+1,1);
        vector<int> primes=vector<int>(), ans=vector<int>(2,-1);
        if(left<=2 && right>=3) return {2,3};
        
        is_primes[0] = is_primes[1] = 0;
        int sqrt_right=sqrt(right);
        for(int i = 3;i<=sqrt_right;i+=2) {
            if(is_primes[i]==1) {
                if(i-2>=left && is_primes[i-2]==1)  return {i-2,i};
                for(int j = i+(i+i);j<=right;j+=(i+i)) {
                    is_primes[j] = 0;
                    
                }                
            }
        }
        int min_gap = INT_MAX;
        
        printf("primes = ");
        if(left%2==0) left+=1;
        for(int i = left;i<=right;i+=2) {
            //if(i%2==0) continue;
            if(is_primes[i]==1) { 
                printf("%d,",i);
                if(primes.size()>0) {
                    int gap = i - primes.back();
                    if(gap<min_gap) {
                        printf("gap<min_gap, gap = %d, min_gap = %d\n", gap, min_gap);
                        min_gap = gap;
                        ans[0] = primes.back();
                        ans[1] = i;
                        if(min_gap==2) return ans;
                    }
                }
                primes.push_back(i);
            }
        }
        printf("\n");
        if(ans[0]!=-1)return ans;
        return vector<int>{-1,-1};
    }
    
